import classes from "./Activity.module.css";

export default function StaffList({ player }) {
  return (
    <div className={classes.player}>
      <img
        alt=""
        src={`https://skins.mcskill.net/?name=${player}&mode=5&fx=64&fy=64`}
      ></img>
      <h1 id={player.rank}>{player.name}</h1>
    </div>
  );
}
